import React, { useState } from 'react';
import { Container, Tabs, Tab } from 'react-bootstrap';
import QuestionImporter from '../components/QuestionImporter';

function QuestionManager() {
  const [activeTab, setActiveTab] = useState('import');

  return (
    <Container>
      <h2 className="mb-4">Question Manager</h2>
      
      <Tabs
        activeKey={activeTab}
        onSelect={(tab) => setActiveTab(tab)}
        className="mb-4"
      >
        <Tab eventKey="import" title="Import Questions">
          <QuestionImporter />
        </Tab>
        
        <Tab eventKey="manage" title="Manage Questions">
          <div className="text-center py-5">
            <h5>Question Management</h5>
            <p>Add, edit, and delete individual questions.</p>
            <p><em>Feature coming soon...</em></p>
          </div>
        </Tab>
      </Tabs>
    </Container>
  );
}

export default QuestionManager;
